/// Dispatcher for `Intf` servants.
public struct IntfDisp: Ice.Dispatcher {
    public let servant: Intf
    private static let defaultObject = Ice.ObjectI<IntfTraits>()

    public init(_ servant: Intf) {
        self.servant = servant
    }

    public func dispatch(_ request: Ice.IncomingRequest) async throws -> Ice.OutgoingResponse {
        switch request.current.operation {
        case "context":
            try await servant._iceD_context(request)
        case "cookie":
            try await servant._iceD_cookie(request)
        case "current":
            try await servant._iceD_current(request)
        case "del":
            try await servant._iceD_del(request)
        case "ice_id":
            try (servant as? Ice.Object ?? IntfDisp.defaultObject)._iceD_ice_id(request)
